import streamlit as st
import pandas as pd
import plotly.express as px
import calendar
import subprocess

# Function to load data from URL
def load_data(url):
    try:
        df = pd.read_csv(url)

        # Remove leading and trailing spaces from column names
        df.columns = df.columns.str.strip()

        # Rename columns to remove extra spaces
        df.rename(columns={" WITHDRAWAL AMT ": "WITHDRAWAL AMT", " DEPOSIT AMT ": "DEPOSIT AMT"}, inplace=True)

        # Convert column data types
        df['WITHDRAWAL AMT'] = df['WITHDRAWAL AMT'].replace({',': ''}, regex=True).astype(float)
        df['DEPOSIT AMT'] = df['DEPOSIT AMT'].replace({',': ''}, regex=True).astype(float)
        df['DATE'] = pd.to_datetime(df['DATE'], format='%d-%b-%y')
        df['MONTH'] = df['DATE'].dt.month.apply(lambda x: calendar.month_abbr[x])
        return df
    except Exception as e:
        print("Error loading data:", e)
        return pd.DataFrame()

# Streamlit app
def main():
    col1, col2 = st.columns([1, 1])
    with col1:
        # Logo with reduced padding
        st.sidebar.image('myLogo.png', use_column_width=True, output_format='PNG', width=200)
        st.sidebar.markdown("<style>img {padding: 0px;}</style>", unsafe_allow_html=True)

    with col2:
        # Money Mind Pal title with custom font size, font family, and bold style
        st.sidebar.markdown(
            "<h1 style='text-align: center; font-size: 40px; font-family: Arial, sans-serif; font-weight: bold; margin-top: 0px; margin-bottom: 0px;'>Money Mind Pal</h1>",
            unsafe_allow_html=True)

    st.markdown(
        """
        <style>
        .st-ec {
            width: 350px !important;
        }
        .stButton>button {
            width: 300px; /* Adjust the width as needed */
            margin: 0 auto; /* Center align the button */
        }
        </style>
        """,
        unsafe_allow_html=True
    )

    # Now create the button
    if st.sidebar.button('Dashboard'):
        col1, col2 = st.columns([4, 1])
        with col1:
            st.title(':bar_chart: Financial Dashboard')
        with col2:
        # Notification bell icon and dropdown menu
            st.markdown(
                """
                <style>
                .notification {
                    position: absolute;
                    top: 10px;
                    right: 10px;
                    cursor: pointer;
                    font-size: 14px;
                    color: #FFA500; /* Change color to orange */
                    z-index: 2;
                }
                .dropdown-content {
                    display: none;
                    position: absolute;
                    background-color: #f9f9f9;
                    min-width: 230px;
                    box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
                    z-index: 1;
                    width: 250px; /* Initial width */
                    border: 1px solid #ccc;
                    border-radius: 5px; /* Add rounded border */
                }

                .dropdown-content a {
                    color: black;
                    padding: 12px 16px;
                    text-decoration: none;
                    display: block;
                }
                .dropdown-content a:hover {
                    background-color: #f1f1f1;
                }
                .dropdown:hover .dropdown-content {
                    display: block;
                }
                </style>
                """
                , unsafe_allow_html=True
            )

            st.markdown(
                """
                <div class="notification dropdown" onclick="toggleDropdown()">
                    <img src="https://img.icons8.com/ios-filled/50/FFA500/bell.png" class="bell-icon" style="width: 30px; height: 30px;"/>
                    <div class="dropdown-content" id="dropdown-content">
                        <a href="#">1. Hey pal. Seems like you've spent 233 dollars in the last 3 months on coffee. I also noticed you are on your 4th streak of Costa Coffee this week. Did you know you can get your next coffee at Costa's completely for free.</a>
                        <img src="data:image/jpeg;base64," style="width: 250px; height: 100px;"/>
                        <a href="#">2. Hey Pal, looks like you are 80% on your way to hit your Ice Cream spending limit. Watch out 👀 </a>
                    </div>
                </div>
                <script>
                    function toggleDropdown() {
                        var dropdown = document.getElementById('dropdown-content');
                        dropdown.style.display = (dropdown.style.display === 'block') ? 'none' : 'block';
                    }
                </script>
                """
                , unsafe_allow_html=True
            )

        # Dataset URL
        data_url = "https://raw.githubusercontent.com/NafeesSadat/Hackathon2024/main/UMH24%20-%20FinTech%20Dataset.xlsx%20-%20Ahmad.csv"

        # Load data
        data = load_data(data_url)

        # Total withdrawal, total deposit
        total_withdrawal = data['WITHDRAWAL AMT'].sum()
        total_deposit = data['DEPOSIT AMT'].sum()

        st.subheader('Total Withdrawal Amount by Category')
        if 'CATEGORY' in data.columns and 'WITHDRAWAL AMT' in data.columns:
            fig_category_bar = px.bar(data.groupby('CATEGORY')['WITHDRAWAL AMT'].sum().reset_index(),
                                    x='WITHDRAWAL AMT', y='CATEGORY',  # Swapping x and y parameters
                                    title='Total Withdrawal Amount by Category',
                                    text=data.groupby('CATEGORY')['WITHDRAWAL AMT'].sum().astype(int),
                                    color='CATEGORY',
                                    labels={'WITHDRAWAL AMT': 'Total Withdrawal'},
                                    orientation='h',  # Setting orientation to horizontal
                                    template='plotly_white')
            fig_category_bar.update_traces(texttemplate='%{text:.2s}', textposition='outside')
            fig_category_bar.update_layout(yaxis=dict(title=None, tickmode='linear', tickfont=dict(size=10)),
                                            xaxis=dict(title='Total Withdrawal', tickfont=dict(size=10)))
            st.plotly_chart(fig_category_bar, use_container_width=True)

        # Trends: Line Charts and Summary
        st.subheader('Trends')
        col1, col2 = st.columns([1, 1])

        # Line Chart for withdrawals by month
        with col1:
            if 'MONTH' in data.columns and 'WITHDRAWAL AMT' in data.columns:
                fig_withdrawal_line = px.line(data.groupby('MONTH')['WITHDRAWAL AMT'].sum().reset_index(),
                                            x='MONTH', y='WITHDRAWAL AMT', title='Total Withdrawal Amount by Month',
                                            hover_data=['WITHDRAWAL AMT'])
                st.plotly_chart(fig_withdrawal_line, use_container_width=True)

        # Line Chart for deposits by month
        with col2:
            if 'MONTH' in data.columns and 'DEPOSIT AMT' in data.columns:
                fig_deposit_line = px.line(data.groupby('MONTH')['DEPOSIT AMT'].sum().reset_index(),
                                        x='MONTH', y='DEPOSIT AMT', title='Total Deposit Amount by Month',
                                        hover_data=['DEPOSIT AMT'])
                st.plotly_chart(fig_deposit_line, use_container_width=True)

        # Summary: Total withdrawal, total deposit
        st.subheader('Summary')
        col1, col2 = st.columns([1, 1])

        with col1:
            st.metric(label="Total Withdrawal", value=f"${total_withdrawal:,.2f}")

        with col2:
            st.metric(label="Total Deposit", value=f"${total_deposit:,.2f}")

        # Category Distribution: Pie Chart and Logo
        st.subheader('Category Distribution')
        col1, col2 = st.columns([4, 1])

        with col1:
            if 'CATEGORY' in data.columns:
                fig_pie = px.pie(data, names='CATEGORY', title='Distribution by Category')
                st.plotly_chart(fig_pie, use_container_width=True)

        with col2:
            st.image('animation_5.gif', use_column_width=True, width=500, clamp=True)
            st.title('MMP ChatBot')

    # Chatbot button (currently without functionality)
    if st.sidebar.button('Chatbot'):
        subprocess.Popen(["streamlit", "run", "chatbot.py"])
        

# Run the app
if __name__ == "__main__":
    main()
